CREATE TABLE indiewise_db.Reaction
(
    id char(36) PRIMARY KEY NOT NULL,
    createdAt datetime,
    emotion varchar(255),
    updatedAt datetime,
    project char(36),
    user char(36),
    CONSTRAINT project_project_bkname_reactions FOREIGN KEY (project) REFERENCES Project (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT users_user_bkname_reactions FOREIGN KEY (user) REFERENCES users (id) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE INDEX project_project_bkname_reactions ON indiewise_db.Reaction (project);
CREATE UNIQUE INDEX reaction_id_unique ON indiewise_db.Reaction (id);
CREATE INDEX users_user_bkname_reactions ON indiewise_db.Reaction (user);
